import React from 'react';
import ReactDOM from 'react-dom';
let Person = (props) => <h1> Welcome {props.name} </h1>
class App extends React.Component{
  constructor(){
    super();
    this.state = {
      name: ''

    }
  }
  setName = () => {this.setState({name: "Seytech"})}
  render(){
    return (
      <div>
        <Person name={this.state.name}  />
        <button onClick={this.setName}>Set State</button>
      </div>
    )
  }

}


ReactDOM.render(
  <App/>,
  document.getElementById('root')

);
